        return (
            <div>
                <img src="https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.slate.fr%2Fsites%2Fdefault%2Ffiles%2Fstyles%2F1060x523%2Fpublic%2F1_104.jpg&imgrefurl=http%3A%2F%2Fwww.slate.fr%2Fstory%2F177021%2Fgastronomie-plats-du-jour-paris-restaurant&docid=je5Mm3q1-eRDJM&tbnid=Mo9g6jKNoprDcM%3A&vet=10ahUKEwivmoSZmMvjAhWMN8AKHaXND3AQMwiXAShKMEo..i&w=1060&h=523&client=ubuntu&bih=771&biw=1600&q=image%20public%20plat%20de%20cuisine&ved=0ahUKEwivmoSZmMvjAhWMN8AKHaXND3AQMwiXAShKMEo&iact=mrc&uact=8" alt="bgc"/>
            </div>
        );
    }
};

export default DemoCarousel
